import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';

export default function InfoBox({info}){
    const INIT_URL = "data:image/jpeg;base64,"
    const HOT_URL="data:image/jpeg;base64,";
    const COLD_URL="data:image/jpeg;base64,";
    const RAIN_URL="data:image/jpeg;base64,";

    return (
        <div className="InfoBox">
            <Card sx={{ maxWidth: 345 }}>
      <CardMedia
        sx={{ height: 140 }}
        image={info.humidity>80?RAIN_URL:info.temp>15?HOT_URL:COLD_URL}
        title="green iguana"
      />
      <CardContent>
        <Typography gutterBottom variant="h5" component="div">
          {info.city}
        </Typography>
        <Typography variant="body2" sx={{ color: 'text.secondary' }}>
          <p>Temperature: {info.temp}&deg;C</p>
          <p>Feels Like: {info.feelslike}&deg;C</p>
          <p>Temperature MAX: {info.tempMax}&deg;C</p>
          <p>Temperature MIN: {info.tempMin}&deg;C</p>
          <p>Humidity: {info.humidity}</p>
          <p>Weather: {info.weather}</p>
        </Typography>
      </CardContent>
    </Card>
        </div>
    )
}